import React from 'react';


const SendMessageForm = () => {
    return (
        <div>
            <form className="new-name my-3">
                <div className="input-group">
                    <input type="text" id="name"  className="form-control"  placeholder="Get a name" required />
                    <input type="text" id="message"  className="form-control"  placeholder="Type your message..."  required/>
                    <button type="submit" className="btn btn-success btn-lg btn-sm">Send</button>
                </div>
                
            </form>
            
        </div>
    )
}

export default SendMessageForm
